	{ Id= 11103, OnlyId= "LG_Con_Fix_0003", CNText= "壮大学院光靠学员内部推荐可不行哦，您75岁的贴身秘书<color='#ffd965'>米兰达</color>扶了扶老花镜，颤颤巍巍地说道：“<color='#ffd965'>招募所</color>你都不建，你建什么？见钱眼开吗？”", TCText= "空缺", ENText= "Empty", JPText= "しばらく", KOText= "공석", VIText= "chỗ trống"},
	{ Id= 11104, OnlyId= "LG_Con_Fix_0004", CNText= "<color='#ffd965'>克莱特</color>背着女学员在一个隐蔽角落缓解腹部压力的时候，意外发现了一座废弃的<color='#ffd965'>铜矿场</color>，是否派遣学员进行开采？", TCText= "空缺", ENText= "Empty", JPText= "しばらく", KOText= "공석", VIText= "chỗ trống"},
	{ Id= 11105, OnlyId= "LG_Con_Fix_0005", CNText= "<color='#ffd965'>弓手</color>可以对纵列敌人进行群体攻击，大幅增强团队输出能力，艾米向您推荐了她的表姐<color='#ffd965'>劳拉</color>，一位成熟性感的冷酷<color='#ffd965'>弓手</color>，是否邀请她加入学院？", TCText= "空缺", ENText= "Empty", JPText= "しばらく", KOText= "공석", VIText= "chỗ trống"},
	{ Id= 11106, OnlyId= "LG_Con_Fix_0006", CNText= "您75岁的贴身秘书<color='#ffd965'>米兰达</color>用手轻轻怼了怼你的胸口，问道“疼吗”，您还没来得及开口，米兰达突然操起拐杖对着您的头部就是一记重击:“什么道理？”您捂着头委屈的说道“奶奶，我这就找人去建<color='#ffd965'>锻造屋</color>”", TCText= "空缺", ENText= "Empty", JPText= "しばらく", KOText= "공석", VIText= "chỗ trống"},
	{ Id= 11107, OnlyId= "LG_Con_Fix_0007", CNText= "您在路上偶遇了一位叫<color='#ffd965'>塞拉</color>的迷糊少女，据说她正准备前往<color='#ffd965'>林荫镇</color>帮助镇民对抗<color='#ffd965'>瘟疫</color>，但显然这并不容易，为了不再让她出现逆行14天的悲剧，您决定？", TCText= "空缺", ENText= "Empty", JPText= "しばらく", KOText= "공석", VIText= "chỗ trống"},
	{ Id= 11108, OnlyId= "LG_Con_Fix_0008", CNText= "<color='#ffd965'>克莱特</color>在被野猪追逐的时候，慌不择路，意外跌入一座废弃的<color='#ffd965'>金矿</color>，是否派遣学员进行开采？", TCText= "空缺", ENText= "Empty", JPText= "しばらく", KOText= "공석", VIText= "chỗ trống"},
	{ Id= 11109, OnlyId= "LG_Con_Fix_0009", CNText= "<color='#ffd965'>米兰达</color>颤颤巍巍地抬起头，看着眼前恢弘又残败的<color='#ffd965'>遗迹</color>，缓缓说道“这里埋葬着<color='#ffd965'>众神遗落的力量</color>，只有找到它们，我们才有机会结束这场灾难。孩子们，答应我，千万不要勉强自己，找不到<color='#ffd965'>众神宝物</color>也没关系，继续找，不要回来就是了！”", TCText= "空缺", ENText= "Empty", JPText= "しばらく", KOText= "공석", VIText= "chỗ trống"},
	{ Id= 11110, OnlyId= "LG_Con_Fix_0010", CNText= "学员们从狗头人手中救下了被劫持的镇民，并在关押镇民的洞穴意外发现了一个<color='#ffd965'>锡矿场</color>，是否派遣学员进行开采？", TCText= "空缺", ENText= "Empty", JPText= "しばらく", KOText= "공석", VIText= "chỗ trống"},
	{ Id= 11111, OnlyId= "LG_Con_Fix_0011", CNText= "你从幽冥巨狼手中救下了一位身穿白袍的<color='#ffd965'>妙龄少女</color>，看她的装束应该是一位新人法师，是否将她招入学院？", TCText= "空缺", ENText= "Empty", JPText= "しばらく", KOText= "공석", VIText= "chỗ trống"},
	{ Id= 11112, OnlyId= "LG_Con_Fix_0012", CNText= "偶遇传奇英雄<color='#ffd965'>剑圣埃尔维斯</color>，若能得到他的指导学员将获得更快速的成长，是否邀请大师分享他的战斗心得？", TCText= "空缺", ENText= "Empty", JPText= "しばらく", KOText= "공석", VIText= "chỗ trống"},
	{ Id= 11113, OnlyId= "LG_Con_Fix_0013", CNText= "城镇需要英雄驻守，以抵御来袭的魔物，<color='#ffd965'>铁桶镇镇长</color>希望学院能派遣一些<color='#ffd965'>满级学员</color>入驻铁桶镇，保护镇民的安全，保障城镇恢复正常运转", TCText= "空缺", ENText= "Empty", JPText= "しばらく", KOText= "공석", VIText= "chỗ trống"},
	{ Id= 11114, OnlyId= "LG_Con_Fix_0014", CNText= "驻守<color='#ffd965'>铁桶镇</color>的英雄现在急需装备来武装自己，<color='#ffd965'>镇长</color>知道学院有精湛的锻造技术，希望学院能向城镇伸出援手，帮忙打造一些优质装备", TCText= "空缺", ENText= "Empty", JPText= "しばらく", KOText= "공석", VIText= "chỗ trống"},
	{ Id= 11115, OnlyId= "LG_Con_Fix_0015", CNText= "<color='#ffd965'>米兰达</color>站在<color='#ffd965'>森林遗迹</color>入口处的一块大石上，高举手中的拐杖，慷慨激昂地冲学员们喊道“孩子们，你们都是被众神选中的<color='#ffd965'>天选之子</color>，你们英勇无畏，你们战无不胜，邪恶与黑暗在你们面前将不堪一击，去吧，碾碎它们，把<color='#ffd965'>众神宝物</color>带回来”", TCText= "空缺", ENText= "Empty", JPText= "しばらく", KOText= "공석", VIText= "chỗ trống"},
	{ Id= 11116, OnlyId= "LG_Con_Fix_0016", CNText= "<color='#ffd965'>克莱特</color>在寻找掉队的<color='#ffd965'>塞拉</color>时，意外发现一座废弃的<color='#ffd965'>铁矿</color>，是否派遣学员进行开采？", TCText= "空缺", ENText= "Empty", JPText= "しばらく", KOText= "공석", VIText= "chỗ trống"},
